import React from 'react'
import ExploreCarousel from './WorlTradeCenterComp/ExploreCarousel'
import FlipSection from './WorlTradeCenterComp/FlipSection'
import ChurchgateTowersSection from './WorlTradeCenterComp/ChurchgateTowersSection'
import RollerCoasterText from '../AboutPage/AboutPageComp/RollerCoasterAnim'
import WTCImage from './WorlTradeCenterComp/WTCYoutube'
import WTCLead from './WorlTradeCenterComp/WTCLead'
import WTCCards from './WorlTradeCenterComp/WTCCards'
import WTCHero from './WorlTradeCenterComp/WTCHero'
import WTCYoutube from './WorlTradeCenterComp/WTCYoutube'

const WorlTradeCenter = () => {
    return (
        <div>
            <WTCHero />
            <WTCYoutube />
            <WTCCards />
            <FlipSection />
            <RollerCoasterText />
            {/* <WTCLead /> */}
            {/* <ExploreCarousel /> */}
            {/* <WTCImage /> */}
            {/* <ChurchgateTowersSection /> */}
            {/* <Appointment /> */}
        </div>
    )
}

export default WorlTradeCenter
